import React from 'react';

const Navbar = () => {
  return (
    <nav className="flex items-center justify-between p-4 bg-blue-600 text-white shadow-md">
      {/* Left side: Quiz Image */}
      <div className="flex items-center">
        <img 
          src="/quiz-logo.png" 
          alt="Quiz Logo" 
          className="h-12 w-12 object-contain"
        />
        <span className="ml-2 text-xl font-bold">Quiz App</span>
      </div>
      
      {/* Right side: Login Instructions */}
      <div className="flex items-center space-x-4">
        <p className="text-sm hidden sm:block">Follow the instructions before login</p>
        <button className="bg-white text-blue-600 px-4 py-2 rounded-md hover:bg-gray-200">Login</button>
      </div>
    </nav>
  );
};

export default Navbar;
